import { Button } from "@mui/material";
import React from "react";
import { Link } from "react-router-dom";

const ErrorPage = () => {
  return (
    <div>
      <h3> 404 Error </h3>
      <p>This url is not matched.</p>

      <Button
        color="inherit"
        component={Link}
        to="/"
        style={{ textDecoration: "none", color: "inherit" }}
      >
        Go To Home Page
      </Button>
    </div>
  );
};

export default ErrorPage;
